########################### Prologue ###########################
# A VGA Display Interface With Following Capabilities:
# - Resolution, background, other color schemes etc. configuration functions (320x240, 640x480, 1024x768)
# - Two section text display
# - Graphics drawing functions
# - Usage logic emulates that of a traditional PC program, sheilding away from low level details
# - Implemented in assembly, adhering to ABI standards
# - No interrupts used
# - Two modes of operation: immediate and state-oriented
# Programming format convention used in this code
# - Internal labels use _label to indicate logics inside a function
# - Variables creation uses _variableName to indicate as well
# - Uses C style nesting of code blocks
# - Functions using FunctionNameUpperCaseFirstWord style
# - Function inputs and outputs are somewhat condensed but mostly take easy-to-use as priority
# - Function inputs and outputs use r2-r3 and r4-r7 first then fall back to stacks
# - Global variables and data blocks are allocated
# - Might consider using .include to seperate execution program from interface logics (if supported by compiler)
# - Use labels to indicate scopes within functions (rather than same-line comments, which is only used to indicate specific variable meanings)
# - Function doesn't change r4-r7 but might change r2-r3
# - Notice our functions saved caller save functions and ra (which is not necessary), which isn't a problem as long as it's kept inside the interface
#   i.e. we don't call outside functions
# Interface Specs
# - Resolution: 320x240, (default)640x480, 1024x768
# - Coordinate system:
#		x is horizontal axis and y is vertical axis;
#		UL->LR x and y;
#		We also support a negative system from LR->UL
# - Image: bitmap true color RGB per pixel, plux width and height information, UL to LR
# Current Status
# - Color mode is still 565 even though we internally save 24 bit colors
# - Screen resolution is limited to 320x240 due to pixel format
# - Users are encounraged to use expected inputs even though currently are advanced features are not supported
#################################################################

.include "keyboard.s"
.section .data
########################### Application Data ###########################
ApplicationGlobalVariables:
  .align 2 # Align on 4 byte boundaries
PromptSymbol: .asciz "> "
VeryLongTestString0: .asciz "********************************************************************************"
VeryLongTestString1: .asciz "Regular Expression Matching Game:                                               " # one line
VeryLongTestString2: .asciz "Please match item 1, 2, 3 from all items                                        "
TestItem1:  .asciz "abc@gmail.com"
TestItem2:  .asciz "xss@gmail.com"
TestItem3:  .asciz "basic@outlook.com"
TestItem4:  .asciz "outlook.com"
TestItem5:  .asciz ".net"
TestItem6:  .asciz "ece243@mail.utoronto.ca"
Separator:  .asciz " "
SuccessString:       .asciz "Matching Success!                                                               "
FailureString:       .asciz "Matching Failed!                                                                "
NullString:          .asciz "   "

########################### VGA Interface Data ###########################
ConfigurationConstants:
  # .equ PixelByteSize, 3 # 3 bytes so RGB each takes 1 byte; Notice this is the assumed size for all draw functions and
    # thus cannot be changed casually
RegisterLocations:
  .align 2 # Align on 4 byte boundaries
  # Pixel Address = base address + x,y offset: (base:14)00001000000000 (y:8)00000000 (x:9)000000000 (just needed:1)0
  .equ VGA_PIXEL_BUFFER, 0x08000000
  .equ VGA_CHARACTER_BUFFER, 0x09000000 # Character Address = (base:).. (y:6) (x:7); Limit 80x60
    .equ VGA_BUFFER_REGISTER, 0xFF203020 # Write 1 to this register to do a swap, Not directly used otherwise
    .equ VGA_BUFFERBACK_REGISTER, 0xFF203024 # Poll before draw
    .equ VGA_RESOLUTION_REGISTER, 0xFF203028 # Y(31:16), X(15:0)
    .equ VGA_STATUS_REGISTER, 0xFF20302C # Poll 0th bit for synchronization status
    .equ PIXEL_BUFFER_CONTROL, 0xFF20302F
    .equ CHARACTER_BUFFER_CONTROL, 0xFF203037 # Not used
GlobalVariables:
  .align 2 # Align on 4 byte boundaries
  DisplayResolution: .word 0	# Current screen resolution selection, 0 for 640*480, 1 for 1024*768
    BackgroundColor: .word 0	# Background color for clear screen, format: RGB0
    DefaultTextColor: .word 0	# Text color for state texts, format: RGB0
  DrawColor: .word 0	# Current draw color for active draw calls, formar: RGB0, each taking one byte (independent of current color mode)
    DrawMode: .word 1 # Current draw mode, immediate mode(0b1) draw to front buffer and shows immediately; double buffer mode(0b0) requires calling SwapBuffers()
  WelcomeText: .asciz "Hello World!" # Currently not used
  .align 2 # Align on 4 byte boundaries
    ImageWidth: .word 320
    ImageHeight: .word 240
