########################### Application Program ###########################
#_start:	# Test Function
initialize_all:
  subi sp, sp, 4
  stw ra, 0(sp)
  
  # Assign stack
  # movia sp, 0x00004000
  # movia sp, 0x00400000

  # Run application
  call REGameGraphicsSetup
  # Set up other stuff
  call initialize_keyboard

  movi r4, 0
  call render_result

  # Infinite loop: refresh screen display per request by calling REGameRefresh()
  Loop: 
  # keep checking status of keyboard buffer
  call get_input_status
  beq r0, r2, Loop
  call update_screen
  br Loop
  
  ldw ra, 0(sp)
  addi sp, sp, 4
  
  /* render the matching result
@register r4: bool result
  */
render_result:
  subi sp, sp, 4
  stw ra, 0(sp)

  mov r5, r4

  # clear history string
  call ClearHistoryStringBuffer

  # render the game instructions
  movia r4, VeryLongTestString1
  call AppendStringToHistory
  movia r4, VeryLongTestString2
  call AddNewStringToHistory
  movia r4, Separator
  call AddNewStringToHistory
  
  # append test items
  movia r4, TestItem1
  call AddNewStringToHistory
  movia r4, Separator
  call AddNewStringToHistory
  movia r4, TestItem2
  call AddNewStringToHistory
  movia r4, Separator
  call AddNewStringToHistory
  movia r4, TestItem3
  call AddNewStringToHistory
  movia r4, Separator
  call AddNewStringToHistory
  movia r4, TestItem4
  call AddNewStringToHistory
  movia r4, Separator
  call AddNewStringToHistory
  movia r4, TestItem5
  call AddNewStringToHistory
  movia r4, Separator
  call AddNewStringToHistory
  movia r4, TestItem6
  call AddNewStringToHistory
  movia r4, Separator
  call AddNewStringToHistory
  
  # false: match failed
  beq r0, r5, render_result_match_failed
  # success
  br render_result_match_successful

render_result_match_successful:
  movia r4, SuccessString
  call AddNewStringToHistory
  br exit_render_result

render_result_match_failed:
  movia r4, FailureString
  call AddNewStringToHistory
  br exit_render_result

exit_render_result:
  call REGameRefresh
  ldw ra, 0(sp)
  addi sp, sp, 4
  ret

  /* update user input and match result. TO BE CALLED BY ihandler */
update_screen:
  subi sp, sp, 12
  stw ra, 0(sp)
  stw r16, 4(sp) # input string
  stw r17, 8(sp) # result

  # update user input
  call ClearCommandStringBuffer
  call get_input_string
  mov r4, r2
  mov r16, r2
  call AddNewStringToCommand
  movia r4, NullString
  call AppendStringToCommand
  
  # update matching result

  # match item 1 ~ 3 (result should all be successful)
  movi r17, 1 # match result initially 1
  # match item 1
  movia r5, TestItem1
  mov r4, r16
  call re_match
  and r17, r17, r2
  # match item 2
  movia r5, TestItem2
  mov r4, r16
  call re_match
  and r17, r17, r2
  # match item 3
  movia r5, TestItem3
  mov r4, r16
  call re_match
  and r17, r17, r2
  beq r17, r0, update_screen_match_failed

  # match item 4 ~ 6 (result should all be failed)
  movi r17, 0 # match result initially 0
  # match item 4
  movia r5, TestItem4
  mov r4, r16
  call re_match
  or r17, r17, r2
  # match item 5
  movia r5, TestItem5
  mov r4, r16
  call re_match
  or r17, r17, r2
  # match item 6
  movia r5, TestItem6
  mov r4, r16
  call re_match
  or r17, r17, r2
  bne r17, r0, update_screen_match_failed

  br update_screen_match_successful

update_screen_match_successful:
  movi r4, 1
  call render_result
  br exit_update_screen

update_screen_match_failed:
  movi r4, 0
  call render_result
  br exit_update_screen

exit_update_screen:
  ldw ra, 0(sp)
  ldw r16, 4(sp)
  ldw r17, 8(sp)
  addi sp, sp, 12
  ret

