# Call this function before other graphics actions to initialize drawing
# Default color mode 24bits true color
# @Input-Resolution: first bit of r4, 0 for 640x480, 1 for 1024x768
# @Input-BackgroundColorR: forth byte of r4, 8bit
# @Input-BackgroundColorG: third byte of r4, 8bit
# @Input-BackgroundColorB: second byte of r4, 8bit
# @Input-DefaultTextColorR: third byte of r5, 8bit
# @Input-DefaultTextColorG:	second byte of r5, 8bit
# @Input-DefaultTextColorB:	first byte of r5, 8bit
# @Return: nothing
SetUpGraphics:
  # Push Stack
    addi sp, sp, -32
    stw r8, 0(sp)
    stw r9, 4(sp)
    stw r10, 8(sp)
    stw ra, 12(sp)
    stw r4, 16(sp)
    stw r5, 20(sp)
    stw r6, 24(sp)
    stw r7, 28(sp)
