    #..# Set color mode to true color 24 bits
    #..movia r8, VGA_STATUS_REGISTER
    #..ldw r9, 0(r8)	# r9 is status value of status register
  #..movi r10, 0xFFFFFF0F # <Change - Typo> r10 defines a mask for B field in status register, we need to set it to 4 or 3
    #..and r9, r9, r10   # r9 now is the original value with B field changed to 0
    #..movi r10, 0x00000040
    #..or r9, r9, r10  # r9 now is the original value with B field changed to 4 or 3, so each pixel is 4 bytes, i.e. 8 bits per color element (RGB?)
    #..stwio r9, 0(r8)

    # Set backbuffer by duplicating the first one
    # Notice this is reslution and color mode dependent since spacing between pixels change
    movia r8, VGA_BUFFER_REGISTER # VGA_BUFFER_REGISTER's default value isn't VGA_PIXEL_BUFFER so we'd better don't directly load VGA_BUFFER_REGISTER
    ldwio r8, 0(r8)
    # Calcualated requires amount of memory
    mul r9, r2, r3	# Total number of pixels
    muli r9, r9, 2	# <Debug: This is color mode depedent> Size of a pixel buffer in current resolution and color mode is 2
    add r10, r8, r9	# Offset from pixel buffer the size of required bytes to create a second one
    movia r8, VGA_BUFFERBACK_REGISTER # Setup buffer back register
    stwio r10, 0(r8)	# Put the pointer to new buffer memory there*/
    # Load background color and default text color
    movia r2, 0xFFFFFF00
    and r4, r4, r2	# Notice length limit of andi is only 16 bit, so we need to use and with register otherwise this will alter the upper bits of r4
    movia r2, BackgroundColor
    stw r4, 0(r2)
    slli r5, r5, 8
    movia r2, DefaultTextColor
    stw r5, 0(r2)
    # Display welcome text/image in immediate mode
    # ...
  # Pop Stack
    ldw r8, 0(sp)
    ldw r9, 4(sp)
    ldw r10, 8(sp)
    ldw ra, 12(sp)
    ldw r4, 16(sp)
    ldw r5, 20(sp)
    ldw r6, 24(sp)
    ldw r7, 28(sp)
    addi sp, sp, 32
    ret

# Set draw color for draw calls, including drawing shapes and texts
# @Input-ColorR: r4
# @Input-ColorG: r5
# @Input-ColorB: r6
SetDrawColor:
  # Push stack
    addi sp, sp, -20
    stw r4, 0(sp)
    stw r5, 4(sp)
    stw r6, 8(sp)
    stw r7, 12(sp)
    stw ra, 16(sp)
  # Notice this is color mode dependent, and we used 3 bytes true color format
    # Pack colors into r2
    mov r7, r6
    mov r6, r5
    mov r5, r4
    mov r4, r0
    call MakeWord
    slli r2, r2, 8	# From 0RGB to RGB0
    # Set DrawColor global variable
    movia r3, DrawColor
    stw r2, 0(r3)
  # Pop stack
    ldw r4, 0(sp)
    ldw r5, 4(sp)
    ldw r6, 8(sp)
    ldw r7, 12(sp)
    ldw ra, 16(sp)
    addi sp, sp, 20
  ret

# Set current draw mode (1 for immediate, 0 for double buffering)
# @input-mode: r4
SetDrawMode:
    movia r2, DrawMode
    stw r4, 0(r2)
  ret

# Clear pixel and character buffer
ClearScreen:
  # Push Stack
    addi sp, sp, -32
    stw ra, 0(sp)
    stw r8, 4(sp)
    stw r8, 8(sp)
    stw r10, 12(sp)
    stw r4, 16(sp)
    stw r5, 20(sp)
    stw r6, 24(sp)
    stw r7, 28(sp)
  # Clear buffer by filling it with background color
    # Get current resolution
    movia r8, VGA_RESOLUTION_REGISTER
    ldhio r2, 0(r8) # Width
    ldhio r3, 2(r8) # Height
    addi r2, r2, -1 # Coordinate index is 1 unit smaller than actual size
    addi r3, r3, -1
    # Backup current draw color
    movia r8, DrawColor
    ldw r9, 0(r8)
    # Set draw color to default background
    movia r10, BackgroundColor
    ldw r10, 0(r10)
    stw r10, 0(r8)
    # Setup parameters to call
    movi r4, 0
    movi r5, 0
    mov r6, r2
    mov r7, r3
    # Draw a huge square
    call DrawSquare
    # Restore draw color
    stw r9, 0(r8)
    # Also clear character buffer
  call ClearCharacterBuffer
  # Pop Stack
    ldw ra, 0(sp)
    ldw r8, 4(sp)
    ldw r8, 8(sp)
    ldw r10, 12(sp)
    ldw r4, 16(sp)
    ldw r5, 20(sp)
    ldw r6, 24(sp)
    ldw r7, 28(sp)
  addi sp, sp, 32
  ret

# Double buffering
SwapBuffers:
  # Writing the value 1 to the Buffer register, to save trouble we didn't use extra registers
    movia r2, VGA_BUFFER_REGISTER
    movi r3, 1
    stwio r3, 0(r2) # <Debug> Not sure whether we should use stw or stwio
    # Wait until swap is done before return: check and make sure status bit becomes 0
    Checking:
        movia r2, VGA_STATUS_REGISTER
        ldwio r2, 0(r2)
        movi r3, 1	# Mask
        and r2, r2, r3
      beq r2, r0, Success
      br Checking
    Success: ret

