# This function does all graphics setup and draw a frame
REGameGraphicsSetup:
  addi sp, sp, -4
    stw ra, 0(sp)

  # Initialize graphics
    # Get packed word for default background color (Black)
    movi r4, 0 # R
    movi r5, 0 # G
    movi r6, 0 # B
    movi r7, 0 # Filler
    call MakeWord	# Now r2 contains packed RGB0 information
    # ori r2, r2, 0x1	# Set first bit of r2 to 1 so our resolution is highest
    movia r3, 0xFFFFFFFE
    and r2, r2, r3	# Set first bit of r2 to 0 so our resolution is lowest
    mov r8, r2 # Temperarily put r2 there
    # Get packed word for default text color (White)
    movi r4, 0 # Null filler
    movi r5, 255 # R
    movi r6, 255 # G
    movi r7, 255 # B
    call MakeWord	# Now r2 contains packed 0RGB information
    # Call setup graphics
    mov r4, r8
    mov r5, r2
    call SetUpGraphics
    movi r4, 15 # R
    movi r5, 15 # G
    movi r6, 15 # B
    call SetDrawColor
    # Setup command text
    call ClearStringBuffers

    # Clear screen
    call ClearScreen

    # Dram one frame
    call REGameRefresh
    # Draw an background image that will not change
    movi r4, 0
    movi r5, 0
    movia r6, ImageWidth
    ldw r6, 0(r6)
    movia r7, ImageHeight
    ldw r7, 0(r7)
    addi sp, sp, -4
    movia r2, ImageData
    stw r2, 0(sp)
    call DrawImage
    addi sp, sp, 4

    # Swap buffers
    # call SwapBuffers # Not enabled, currently default immediate mode

    ldw ra, 0(sp)
    addi sp, sp, 4
  ret

