# Draw a sqaure in backbuffer
# @input-X1: r4
# @input-Y1: r5
# @input-X2: r6
# @input-Y2: r7
# inputs must from UL to LR region since we don't draw in reverse direction
DrawSquare:
  # Pending coordinate boundary check (Use resolution register of VGA controller)

    # Push stack
    addi sp, sp, -20
    stw r8, 0(sp)
    stw r9, 4(sp)
    stw r10, 8(sp)
    stw r11, 12(sp)
    stw ra, 16(sp)

    # Convert Coordinates
    call ConvertCoordinates
    call ConvertCoordinates2

    # Parameters setup: Get currrent draw buffer
    call GetDrawBuffer
    mov r9, r2
  # Parameters setup: Get currrent draw color in VGA format
    call GetDrawColorVGA
    mov r8, r2

  # Enter loop
    # Loop rows
  mov r2, r5 # r2 is temp x as counter
    LoopRow:
      bgt r2, r7, EndLoopRow	# if not finished all rows then continue
        # Loop columns
    mov r3, r4 # r3 is temp y as counter
        LoopColumn:
          bgt r3, r6, EndLoopColumn	# if not finished all columns then continue
            # Set a pixel color at location
            slli r10, r2, 9		# <Debug> Notice this is sresolution and color mode dependent
            add r10, r10, r3	# r10 is the pixel address offset (pixel offset)
            slli r10, r10, 1	# Multiply by two to make it actual byte offset (This is color mode dependent, currently we use 2 bytes for color so multiply by 2)
            add r11, r9, r10	# Offset address to the pixel
            sthio r8, 0(r11)		# Change value at the location offset from pixel buffer
            # Increment counter
            addi r3, r3, 1
      br LoopColumn
        EndLoopColumn:
    # Increment counter
        addi r2, r2, 1
    br LoopRow
    EndLoopRow:

    # Pop stack
    ldw r8, 0(sp)
    ldw r9, 4(sp)
    ldw r10, 8(sp)
  ldw r11, 12(sp)
    ldw ra, 16(sp)
    addi sp, sp, 20
  ret

