# Draw some texts in backbuffer, left aligned
# Notice the line width 80 in this function is configurable depending on padding setting, in this case (using a background image) we used 78
# @input-X1: r4
# @input-Y1: r5
# @input-Text: r6, null-terminated, pointer
DrawText:
  # Push Stack
    addi sp, sp, -24
    stw r8, 0(sp)
    stw r9, 4(sp)
    stw ra, 8(sp)
    stw r10, 12(sp)
    stw r11, 16(sp)
    stw r12, 20(sp)

    # Convert Coordinates
    call ConvertTextCoordinates

  # Put a text string into character buffer
    # Initialize character buffer pointer
    movia r9, VGA_CHARACTER_BUFFER
    # Copy string pointer
    mov r11, r6
    # Iniitlize line counter
    movi r10, 80 # 78
    movi r12, 0
    sub r10, r10, r4 # Substract specified x coordinate; Notice this will cause new line alignment problem
    # Get a copy of start charcter coordinate
    mov r2, r5 # r5 is y and doesn't change often
    slli r2, r2, 7	# Prepare space for encoding x
    add r2, r2, r4	# Now r2 has the value of next draw location of text
  add r8, r2, r9	# Location for next character
    # Load first character to begin
    ldb r3, 0(r11)
    LoopText:
      beq r3, r0, EndLoopText	# r3 holds the value of next character
      # Set character at buffer location
        stbio r3, 0(r8)
        # Load next character
        addi r11, r11, 1
        ldb r3, 0(r11)
        # Increment draw location
        addi r8, r8, 1
        # Decrement line counter (or should be called current line character counter)
        addi r10, r10, -1
        bne r10, r0, LoopText
          # Increment a line
            addi r12, r12, 1
            # If reaching zero then update a new line
            mov r2, r5
            add r2, r2, r12	# Increment y by current lines
            slli r2, r2, 7	# Prepare space for encoding x
            add r2, r2, r4	# Now r2 has the value of next draw location of text
            add r8, r2, r9	# Location for next character
            # Reset counter
            movi r10, 80 # 78
            sub r10, r10, r4 # Substract specified x coordinate
        br LoopText
    EndLoopText:

    # Pop Stack
    ldw r8, 0(sp)
    ldw r9, 4(sp)
    ldw ra, 8(sp)
    ldw r10, 12(sp)
    ldw r11, 16(sp)
    ldw r12, 20(sp)
    addi sp, sp, 24
  ret

# Clear character buffer
ClearCharacterBuffer:
  # Push Stack
    addi sp, sp, -28
    stw r8, 0(sp)
    stw r9, 4(sp)
    stw ra, 8(sp)
    stw r10, 12(sp)
    stw r11, 16(sp)
    stw r12, 20(sp)
    stw r13, 24(sp)

    # Loop Setup
    movia r8, VGA_CHARACTER_BUFFER # r9 is the character buffer
    movi r13, 0	# Fill character with 0
    movi r10, 60 # Destination row
    movi r11, 80 # Destination column
    # Enter loop
    # Get start location
    movi r2, 0	# Current row
    LoopTextHeight:
      beq r2, r10, EndLoopTextHeight
        movi r3, 0 # Current column
        LoopTextWidth:
          beq r3, r11, EndLoopTextWidth
            # Get the address of the char and set value there
      slli r12, r2, 7	# Prepare address offset
          add r12, r12, r3# Now r12 has the value of next draw location (offset) of text
          add r9, r12, r8	# Location for next character
            # Set character
            stbio r13, 0(r9)
            # Increment draw location
            addi r3, r3, 1
            br LoopTextWidth
        EndLoopTextWidth:
        addi r2, r2, 1
        br LoopTextHeight
    EndLoopTextHeight:

    # Pop Stack
    ldw r8, 0(sp)
    ldw r9, 4(sp)
    ldw ra, 8(sp)
    ldw r10, 12(sp)
    ldw r11, 16(sp)
  ldw r12, 20(sp)
    ldw r13, 24(sp)
    addi sp, sp, 28
  ret

