# Check out piazza one load image and audio
# Draw an image at some location
# @input-x: r4
# @input-y: r5
# @input-w: r6
# @input-h: r7
# @input-d: first element on stack (pointer) (4 bytes), images are (current format) 2 bytes packed RGB 5:6:5 in sequence
# Comment: w*h*2 equals total memory space the image occupies; For current display resopition the image should be most 320*240 in size
# Stack not modified
DrawImage:
  # Pending coordinate boundary check and do clamping

  # Prepare a pointer for the loop
  ldw r10, 0(sp)	# r10 points to image data

    # Push stack
    addi sp, sp, -32
    stw r8, 0(sp)
    stw r9, 4(sp)
    stw r10, 8(sp)
    stw r11, 12(sp)
  stw r12, 16(sp)
    stw ra, 20(sp)
  stw r13, 24(sp)
  stw r14, 28(sp)

    # Convert Coordinates
    call ConvertCoordinates

    # Parameters setup: Get currrent draw buffer
    call GetDrawBuffer
    mov r9, r2

    # Loop rows
  add r11, r4, r6 # Destination width
  add r12, r5, r7 # Destination height
  mov r2, r5 # r2 is temp row (height) counter
    LoopRow_Image: # Be extra careful with using tags since if we just copy and paste we can call undetermined behavior
      bge r2, r12, EndLoopRow_Image	# if not finished all rows then continue # Notice in DrawSquare we used bgt while here we need beq
        # Loop columns
    mov r3, r4 # r3 is temp column counter
        LoopColumn_Image:
          bge r3, r11, EndLoopColumn_Image	# if not finished all columns then continue
      # Load pixle color
      ldh r8, 0(r10)
            # movi r8, 0x3857
      # Increment pixel color counter by 2 bytes
      addi r10, r10, 2
            # Set a pixel color at location
            slli r13, r2, 9		# <Debug> Notice this is sresolution and color mode dependent
            add r13, r13, r3	# r10 is the pixel address offset (pixel offset)
            slli r13, r13, 1	# Multiply by two to make it actual byte offset (This is color mode dependent, currently we use 2 bytes for color so multiply by 2)
            add r14, r9, r13	# Offset address to the pixel
            sthio r8, 0(r14)		# Change value at the location offset from pixel buffer
            # Increment counter
            addi r3, r3, 1
      br LoopColumn_Image
        EndLoopColumn_Image:
    # Increment counter
        addi r2, r2, 1
    br LoopRow_Image
    EndLoopRow_Image:

    # Pop stack
    ldw r8, 0(sp)
    ldw r9, 4(sp)
    ldw r10, 8(sp)
    ldw r11, 12(sp)
  ldw r12, 16(sp)
    ldw ra, 20(sp)
  ldw r13, 24(sp)
  ldw r14, 28(sp)
    addi sp, sp, 32
  ret

