      beq r2, r0, ClearHistoryStringBuffer_End
        stb r3, 0(r8)
        addi r2, r2, -1
        addi r8, r8, 1
		br ClearHistoryStringBuffer_Loop
    ClearHistoryStringBuffer_End:

    # Pop stack
    ldw r8, 0(sp)
    addi sp, sp, 4
  ret

# Clear command string buffer
ClearCommandStringBuffer:
  # Push stack
    addi sp, sp, -12
    stw r8, 0(sp)
    stw r4, 4(sp)
    stw ra, 8(sp)

  # Initialize counter
  movi r2, 800	# Clear 800 characters
    # Initialize reset value
    movi r3, 0
    # Initialize pointer
    movia r8, CommandStringBuffer
    # Set to 0 until reaching the end
    ClearCommandStringBuffer_Loop:
      beq r2, r0, ClearCommandStringBuffer_End
        stb r3, 0(r8)
        addi r2, r2, -1
        addi r8, r8, 1
		br ClearCommandStringBuffer_Loop
    ClearCommandStringBuffer_End:

    # Append a prompt symbol
    movia r4, PromptSymbol
    call AppendStringToCommand

    # Pop stack
    ldw r4, 4(sp)
    ldw r8, 0(sp)
    ldw ra, 8(sp)
    addi sp, sp, 12
  ret

# Add to result(history) text string, will automatically begin a new line if overflow
# DevNote: Practically speaking overflow isn't implemented here but in DrawText()
# @input-string: r4
AppendStringToHistory:
  # Push stack
    addi sp, sp, -12
    stw r8, 0(sp)
    stw r9, 4(sp)
    stw r10, 8(sp)

    # Initialize string pointer
    movia r8, HistoryStringBuffer
    # Count to current end, notice we didn't do a boundary check, i.e. 4800; Also notice History will always have redundant trialing 0
    ldb r3, 0(r8)
    LoopCountHistoryAppend:
      beq r3, r0, LoopCountHistoryAppend_End
        addi r8, r8, 1
        ldb r3, 0(r8)
        br LoopCountHistoryAppend
    LoopCountHistoryAppend_End:
    # Initialize copy buffer
    mov r9, r4
    # Initialize character read
    ldb r10, 0(r9)
    LoopCopyAppendStringToHistory: # Notice we didn't do a boundary check, i.e. 4800
      beq r10, r0, LoopCopyAppendStringToHistory_End
        stb r10, 0(r8)
        addi r8, r8, 1
    addi r9, r9, 1
    ldb r10, 0(r9)
        br LoopCopyAppendStringToHistory
    LoopCopyAppendStringToHistory_End:

  # Pop stack
    ldw r8, 0(sp)
    ldw r9, 4(sp)
    ldw r10, 8(sp)
    addi sp, sp, 12
    ret

# Append a new line then add to result(history) text string, will automatically begin another new line if overflow
# @input-string: r4
AddNewStringToHistory:
  # Push stack
    addi sp, sp, -12
    stw r8, 0(sp)
    stw r9, 4(sp)
    stw r10, 8(sp)

    # Initialize line counter
    movi r2, 80 # Count 80 characters
    # Initialize string pointer
    movia r8, HistoryStringBuffer
    # Count to current end, notice we didn't do a boundary check, i.e. 4800; Also notice History will always have redundant trialing 0
    ldb r3, 0(r8)
    LoopCountHistoryAddNew:
      beq r3, r0, LoopCountHistoryAddNew_End
        addi r8, r8, 1
        ldb r3, 0(r8)
        addi r2, r2, -1 # Decrement r2, r2 represents how many characters are used in current line (To be accurate i.e. 80-r2)
        bne r2, r0, LoopCountHistoryAddNew
        movi r2, 80	# If r2 has reached 0 then reset it
        br LoopCountHistoryAddNew
    LoopCountHistoryAddNew_End:
    # Fill trailing characters in current line with space to emulate a new line
    movi r3, 80
    beq r2, r3, LoopFillNewHistoryWithSpace_End # Skip filling if r2 happens to be 80 then we won't waste a line
    movi r3, 32 # 32 for ASCII space
    LoopFillNewHistoryWithSpace:
      beq r2, r0, LoopFillNewHistoryWithSpace_End
        stb r3, 0(r8)
        addi r8, r8, 1
        addi r2, r2, -1
        br LoopFillNewHistoryWithSpace
    LoopFillNewHistoryWithSpace_End:
    # Initialize copy buffer
    mov r9, r4
    # Initialize character read
    ldb r10, 0(r9)
    LoopCopyAddNewStringToHistory: # Notice we didn't do a boundary check, i.e. 4800
      beq r10, r0, LoopCopyAddNewStringToHistory_End
        stb r10, 0(r8)
        addi r8, r8, 1
        addi r9, r9, 1
        ldb r10, 0(r9)
        br LoopCopyAddNewStringToHistory
    LoopCopyAddNewStringToHistory_End:

  # Pop stack
    ldw r8, 0(sp)
    ldw r9, 4(sp)
    ldw r10, 8(sp)
    addi sp, sp, 12
    ret

# Replace current string in command text
# @input-string: r4
SetCommandTextString:
  # Push stack
    addi sp, sp, -4
    stw r8, 0(sp)

    # Clear current command text
    call ClearCommandStringBuffer
    # Add new command text
    call AppendStringToCommand

  # Pop stack
    ldw r8, 0(sp)
    addi sp, sp, 4
    ret

