AppendCharacterToCommand:
  # Push stack
    addi sp, sp, -4
    stw r8, 0(sp)

    # Initialize string pointer
    movia r8, CommandStringBuffer
    # Count to current end, notice we didn't do a boundary check, i.e. 480; Also notice Command will always have redundant trialing 0
    ldb r3, 0(r8)
    LoopCountCommandAppendCharacter:
      beq r3, r0, LoopCountCommandAppendCharacter_End
        addi r8, r8, 1
        ldb r3, 0(r8)
