  ##################### Helper Functions #####################
# Helper: Get current draw buffer depending on draw mode
# @input: none
# @output: output at r2 current draw buffer address
GetDrawBuffer:
  # Depending on current draw mode we select the appropriate buffer
    # Load current draw mode
    movia r2, DrawMode
    ldw r2, 0(r2)
    bne r2, r0, ImmediateMode
    # Setup pointer to draw buffer accordingly
  DoubleBufferMode:
      movia r2, VGA_BUFFERBACK_REGISTER # Select back buffer
        br ContinueDraw
    ImmediateMode:
      movia r2, VGA_BUFFER_REGISTER # Pointer to current displayed pixel buffer
    ContinueDraw:
    # Actual pixel buffer location
    ldwio r2, 0(r2)
    ret

# Helper: Get current draw color packed in native VGA format ready for drawing
# @input: none
# @output: output at r2 current draw color (for current setup only lower half word is used)
GetDrawColorVGA:
  # Color Setup
  movia r2, DrawColor	# r2 will be the designated pixel value
    ldw r2, 0(r2) # Load pixel color
    # Process pixel color # <Debug> This is color mode dependet
    srli r2, r2, 8 # Remove null byte
    movia r3, 0x001F3F00 # Mask for R&G, use 5 bits for R, 6 bits for G
    and r3, r2, r3 # r3 now contains R&G, normalized
    andi r2, r2, 0x001F	# Use only 5 bits for B
    srli r3, r3, 3
    andi r3, r3, 0xFFE0	# Mask out blue
    or r2, r2, r3
    srli r3, r3, 2
    andi r3, r3, 0xF800	# Mask out green
    or r2, r2, r3 # Now r8 contains R&G&B normalized in only the lower half word
    ret

# Helper: Pack inputs
# Given inputs in r4, r5, r6, r7, one effective byte each, produce output in r2
# r4 will be the highest byte
MakeWord:
  # Push
    addi sp, sp, -8
    stw r8, 0(sp)
    stw ra, 4(sp)
  # Define a mask in case inputs are not clean
    movi r3, 0xFF	# r3 masks only the lower first byte of a register
    # Move r4
    and r2, r3, r4
    # Move r5
    slli r2, r2, 8
    and r8, r3, r5
    or r2, r2, r8
    # Move r6
    slli r2, r2, 8
    and r8, r3, r6
    or r2, r2, r8
    # Move r7
    slli r2, r2, 8
    and r8, r3, r7
    or r2, r2, r8
    # Pop
    ldw r8, 0(sp)
    ldw ra, 4(sp)
    addi sp, sp, 8
  ret

# Helper: Unpack outputs
# Given inputs in r2, produce outpus in r4, r5, r6, r7, one effective byte each -- Notice this is in contrary to ABI
BreakWord:
    # Define a mask to extract bytes
    movi r3, 0xFF
    # Extract r7
    and r7, r2, r3
    # Extract r6
    slli r3, r3, 8
    and r6, r2, r3
    srli r6, r6, 8
    # Extract r5
    slli r3, r3, 8
    and r5, r2, r3
    srli r5, r5, 16
    # Extract r4
    slli r3, r3, 8
    and r4, r2, r3
    srli r4, r4, 24
  ret

# Helper: Negative coordinate system
# These are used internally inside the interface and shouldn't be called by external users
# Convert x in r4 and y in r5 to proper values in current coordinate system, return valud override r4 and r5
ConvertCoordinates:
  # No need to reserve ra
  addi sp, sp, -8
    stw r8, 0(sp)
    stw ra, 4(sp)

  # Load current resolution details
    movia r8, VGA_RESOLUTION_REGISTER
    ldhio r2, 0(r8) # Width
    ldhio r3, 2(r8) # Height
    # Check negative
    CheckX: bge r4, r0, CheckY
  ConvertX:
      add r4, r2, r4
    CheckY: bge r5, r0, FinishConversion
    ConvertY:
      add r5, r3, r5
    FinishConversion:

    # No need to restore ra
    ldw r8, 0(sp)
    ldw ra, 4(sp)
    addi sp, sp, 8
  ret

# Convert x in r6 and y in r7 to proper values in current coordinate system, return valud override r6 and r7
ConvertCoordinates2:
  # No need to reserve ra
  addi sp, sp, -8
    stw r8, 0(sp)
    stw ra, 4(sp)

  # Load current resolution details
    movia r8, VGA_RESOLUTION_REGISTER
    ldhio r2, 0(r8) # Width
    ldhio r3, 2(r8) # Height
    # Check negative
    CheckX2: bge r6, r0, CheckY2
  ConvertX2:
      add r6, r2, r6
    CheckY2: bge r7, r0, FinishConversion2
    ConvertY2:
      add r7, r3, r7
    FinishConversion2:

    # No need to restore ra
    ldw r8, 0(sp)
    ldw ra, 4(sp)
    addi sp, sp, 8
  ret

# Convert x in r4 and y in r5 to proper values in text coordinate system, return valud override r4 and r5
ConvertTextCoordinates:
  # Specify text buffer size
    movi r2, 80
    movi r3, 60
    # Check negative
    CheckTX: bge r4, r0, CheckTY
  ConvertTX:
      add r4, r2, r4
    CheckTY: bge r5, r0, FinishConversionT
    ConvertTY:
      add r5, r3, r5
    FinishConversionT:
  ret

